plot.width = 15, repr.plot.height = 10)\n","\n","# Compute index relative to first point per price type\n","base_index <- idealista_data %>%\n","  filter(region == \"portugal\") %>%\n","  group_by(price_type) %>%\n","  mutate(index = price_per_sqm / first(price_per_sqm) * 100)\n","\n","# Plot indexed evolution\n","ggplot(base_index, aes(x = date, y = index, color = price_type)) +\n","  geom_line(size = 1.2) +\n","  labs(\n","    title = \"Housing Price Evolution in Portugal (Index: Jan 2015 = 100)\",\n","    y = \"Index\", x = NULL,\n","    color = \"Type\"\n","  ) +\n","  theme_minimal(base_size = 20)"]},{"cell_type":"markdown","id":"3da7a1e3","metadata":{"papermill":{"duration":0.012721,"end_time":"2025-07-11T17:21:26.279957","exception":false,"start_time":"2025-07-11T17:21:26.267236","status":"completed"},"tags":[]},"source":["The spike around early 2018 in the \"sale\" price index (and also slightly mirrored in rentals) likely indicates a data artifact, possibly due to:\n","\n","* Erroneous value(s) in Idealista listings for Portugal as a whole (e.g., a district or island temporarily reporting extreme values).\n","* Aggregation issue — maybe some smaller region had anomalously high prices and wasn’t properly diluted in the average.\n","* Scraping glitch — sometimes data pipelines pull erroneous values from listing platforms during updates.\n","* Outlier sale(s) — a few unusually expensive properties (e.g., luxury listings) might distort the average in smaller regions.\n","\n","These anomalies raise questions about the consistency of listing-based sources. To better understand if these spikes reflect real market trends or data artifacts, we will be incorporating official datasets from INE, Banco de Portugal, and others as the project progresses."]},{"cell_type":"markdown","id":"1f1092c1","metadata":{"papermill":{"duration":0.012468,"end_time":"2025-07-11T17:21:26.304925","exception":false,"start_time":"2025-07-11T17:21:26.292457","status":"completed"},"tags":[]},"source":["**3.2 Correlation Between Regions and National Average**\n","\n","We can correlate each region’s trend with the national average. Regions with low correlation may behave differently from the overall trend — either lagging or diverging in dynamics.\n","\n","*3.2.1 Rentals*"]},{"cell_type":"code","execution_count":5,"id":"f658252f","metadata":{"execution":{"iopub.execute_input":"2025-07-11T17:21:26.333994Z","iopub.status.busy":"2025-07-11T17:21:26.33211Z","iopub.status.idle":"2025-07-11T17:21:26.391789Z","shell.execute_reply":"2025-07-11T17:21:26.38988Z"},"papermill":{"duration":0.076969,"end_time":"2025-07-11T17:21:26.394369","exception":false,"start_time":"2025-07-11T17:21:26.3174","status":"completed"},"tags":[]},"outputs":[],"source":["library(dplyr)\n","library(tidyr)\n","library(ggplot2)\n","\n","# Choose price_type to analyze: 'rental' or 'sale'\n","price_type_filter <- \"rental\"\n","\n","# Filter data and pivot\n","regional_matrix <- idealista_data %>%\n","  filter(price_type == price_type_filter) %>%\n","  select(date, region, price_per_sqm) %>%\n","  pivot_wider(names_from = region, values_from = price_per_sqm)\n","\n","# Compute correlation matrix (ignoring rows with NA)\n","cor_matrix <- cor(regional_matrix %>% select(-date), use = \"pairwise.complete.obs\")\n","\n","# Extract correlation with 'portugal' column only\n","portugal_corr <- cor_matrix[\"portugal\", ]\n","portugal_corr_df <- data.frame(\n","  region = names(portugal_corr),\n","  correlation = as.numeric(portugal_corr)\n",") %>%\n","  filter(region != \"portugal\") %>%\n","  arrange(correlation)"]},{"cell_type":"code","execution_count":6,"id":"d1e9d34e","metadata":{"execution":{"iopub.execute_input":"2025-07-11T17:21:26.425207Z","iopub.status.busy":"2025-07-11T17:21:26.423498Z","iopub.status.idle":"2025-07-11T17:21:26.761436Z","shell.execute_reply":"2025-07-11T17:21:26.759418Z"},"papermill":{"duration":0.356615,"end_time":"2025-07-11T17:21:26.764347","exception":false,"start_time":"2