rend, we notice a key distinction:\n","\n","* Rental prices show a strong, consistent correlation across all regions, suggesting that rental markets in Portugal tend to move in unison — likely influenced by broad national socioeconomic factors (e.g. inflation, wage policies, or national demand trends).\n","* In contrast, sale prices display much more regional variability. Several regions — notably Portalegre, Castelo Branco, Beja, and Vila Real — show a weak correlation with the national average (*R²* < 0.75). This suggests that property sale markets are influenced by local dynamics such as:\n","1. regional employment and migration patterns,\n","2. urban development or depopulation trends,\n","3. local investment incentives or stagnation.\n","This discrepancy reinforces the importance of disaggregating the analysis when looking at housing purchase data — a national average might obscure relevant local market phenomena."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":7828255,"sourceId":12412541,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":10.109839,"end_time":"2025-07-11T17:21:29.229661","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2025-07-11T17:21:19.119822","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}